import React, { Component } from "react";
import { Link } from "react-router-dom";
import StudentOfferList from "./StudentOfferList";
import OfferView from "./OfferView";
import NavBar from "../NavBar";

class SearchOffer extends Component {
  Search = props => <Link to="/search-offers" {...props} />;

  MyOffers = props => <Link to="/my-applications" {...props} />;

  render() {
    return (
      <div>
        <NavBar search={this.Search} myOffers={this.MyOffers} />
        <h3>Page Trainee Search Offer</h3>
        <StudentOfferList />
        <OfferView />
      </div>
    );
  }
}

export default SearchOffer;
